import React from "react";

const FEATURED = gql`
  query GetProjects {
    projects {
      data {
        id
        attributes {
          title
          description
          githubUrl
          liveUrl
          badges {
            data {
              attributes {
                badge
              }
            }
          }
          image {
            data {
              attributes {
                url
              }
            }
          }
        }
      }
    }
  }
`;

function Projects() {
  return null;
}

export default Projects;
